import React from "react";
import TemplateAnime from "../Elementos/templateAnime"


function snk(){
    return(
        <div>
            <TemplateAnime LinkAnime="https://iframe.mediadelivery.net/embed/108181/1e70b160-cc16-45ae-bd1f-42e9d2596cdb?autoplay=true" TituloAnime="Attack on Titan " TituloCap="A ti, 2,000 años en el futuro. La caída de Shiganshina - Primera Parte" DescAnime="La humanidad lleva más de un siglo viviendo tras unas murallas inmensas para defenderse de unos extraños seres que amenaza sus vidas. Un día, la paz se verá alterada tras la aparición de un titán cuyo tamaño supera la muralla."/>
        </div>
    );
}

export default snk;
